var integer = require('./lib/integer');
var color = require('./lib/color');
var datetime = require('./lib/datetime');
var uuid = require('./lib/uuid');

module.exports = {
  integer: integer,
  color: color,
  datetime: datetime,
  uuid: uuid
};
